export default function Home() {

  const {fotos, setFotos} = useContext(MyContext);

  return (
    <Container>
      <Row>
        { fotos.map((f)=>{
        <Col><Foto foto={foto}></Foto></Col>
        })}
      </Row>
    </Container>
  );
}
